import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { AuthServiceService } from '../auth-service.service';
import { NgForm } from '@angular/forms';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.scss']
})
export class SignupComponent implements OnInit {

constructor(private service: AuthServiceService,
            private route: Router){ }

  ngOnInit(): void {}

  orgName: string = '';
  contact: string = '';
  email: string = '';
  password: string = '';
  confirmPassword: string = '';
  streetAddress: string = '';
  city: string = '';
  district: string = '';
  block: string = '';
  zipCode: string = '';
  state: string = '';

  onSubmit(signupForm: NgForm) {

    if (!signupForm.valid) {
      console.log('Form is invalid. Please correct the errors.');
      return;
    }

    if (this.password !== this.confirmPassword) {
      console.error('Passwords do not match.');
      return;
    }

    if (signupForm.valid) {
      const formData = new FormData();

      // Append all form fields to the FormData object
      formData.append('orgName', this.orgName);
      formData.append('contact', this.contact);
      formData.append('email', this.email);
      formData.append('password', this.password);
      formData.append('confirmPassword', this.confirmPassword);
      formData.append('streetAddress', this.streetAddress);
      formData.append('city', this.city);
      formData.append('district', this.district);
      formData.append('block', this.block);
      formData.append('zipCode', this.zipCode);
      formData.append('state', this.state)

    console.log('Form data!', formData);

    this.service.signupUser(formData).subscribe((res:any)=>{
      console.log("res-data", res)
      console.log('Form data submitted successfully!!', res);

      // Reset the form
      signupForm.resetForm();

    },(error:any)=>{
      console.log('error in signup-org',error)
    })

    }
  }



}
<div class="container mt-5 mb-5">
  <div class="card shadow-lg p-4">
    <h2 class="text-center mb-4" style="font-size: 20px; font-weight: 700;">Organization Signup</h2>

    <form #signupForm="ngForm" (ngSubmit)="onSubmit()" novalidate>
      <!-- Organization Name -->
      <div class="mb-3">
        <label for="orgName" class="form-label">Organization Name</label>
        <input type="text" id="orgName" [(ngModel)]="orgName" name="orgName" class="form-control" placeholder="Enter organization name" required>
        <div *ngIf="signupForm.submitted && !orgName" class="text-danger">
          Organization Name is required.
        </div>
      </div>

      <!-- Contact and Email -->
      <div class="row">
        <div class="col-md-6 mb-3">
          <label for="contact" class="form-label">Contact</label>
          <input type="tel" id="contact" [(ngModel)]="contact" name="contact" class="form-control" placeholder="Enter contact number" required>
          <div *ngIf="signupForm.submitted && !contact" class="text-danger">
            Contact is required.
          </div>
        </div>
        <div class="col-md-6 mb-3">
          <label for="email" class="form-label">Email</label>
          <input type="email" id="email" [(ngModel)]="email" name="email" class="form-control" placeholder="Enter email address" required>
          <div *ngIf="signupForm.submitted && !email" class="text-danger">
            Email is required.
          </div>
        </div>
      </div>

      <!-- Password and Confirm-Password -->
      <div class="row">
        <div class="col-md-6 mb-3">
          <label for="password" class="form-label">Password</label>
          <input type="password" id="password" [(ngModel)]="password" name="password" class="form-control" placeholder="Enter password" required>
          <div *ngIf="signupForm.submitted && !password" class="text-danger">
            Password is required.
          </div>
        </div>
        <div class="col-md-6 mb-3">
          <label for="password" class="form-label">Confirm Password</label>
          <input type="password" id="confirmPassword" [(ngModel)]="confir" name="confirmPassword" class="form-control" placeholder="Enter confirm password" required>
          <div *ngIf="signupForm.submitted && !confirmPassword" class="text-danger">
            Confirm password is required.
          </div>
        </div>
      </div>


      <!-- Street Address -->
      <div class="mb-3">
        <label for="streetAddress" class="form-label">Street Address</label>
        <input type="text" id="streetAddress" [(ngModel)]="streetAddress" name="streetAddress" class="form-control" placeholder="Enter street address" required>
        <div *ngIf="signupForm.submitted && !streetAddress" class="text-danger">
          Street Address is required.
        </div>
      </div>

      <!-- City and District -->
      <div class="row">
        <div class="col-md-6 mb-3">
          <label for="city" class="form-label">City</label>
          <input type="text" id="city" [(ngModel)]="city" name="city" class="form-control" placeholder="Enter city" required>
          <div *ngIf="signupForm.submitted && !city" class="text-danger">
            City is required.
          </div>
        </div>
        <div class="col-md-6 mb-3">
          <label for="district" class="form-label">District</label>
          <input type="text" id="district" [(ngModel)]="district" name="district" class="form-control" placeholder="Enter district" required>
          <div *ngIf="signupForm.submitted && !district" class="text-danger">
            District is required.
          </div>
        </div>
      </div>

      <!-- Block, Zip Code, and State -->
      <div class="row">
        <div class="col-md-4 mb-3">
          <label for="block" class="form-label">Block</label>
          <input type="text" id="block" [(ngModel)]="block" name="block" class="form-control" placeholder="Enter block" required>
          <div *ngIf="signupForm.submitted && !block" class="text-danger">
            Block is required.
          </div>
        </div>
        <div class="col-md-4 mb-3">
          <label for="zipCode" class="form-label">Zip Code</label>
          <input type="text" id="zipCode" [(ngModel)]="zipCode" name="zipCode" class="form-control" placeholder="Enter zip code" required>
          <div *ngIf="signupForm.submitted && !zipCode" class="text-danger">
            Zip Code is required.
          </div>
        </div>
        <div class="col-md-4 mb-3">
          <label for="state" class="form-label">State</label>
          <input type="text" id="state" [(ngModel)]="state" name="state" class="form-control" placeholder="Enter state" required>
          <div *ngIf="signupForm.submitted && !state" class="text-danger">
            State is required.
          </div>
        </div>
      </div>

      <!-- Submit Button -->
      <div class="text-center mt-4">
        <button type="submit" class="btn btn-primary btn-lg">Sign Up</button>
      </div>
    </form>
  </div>
</div>
